import React from 'react'
import PropTypes from 'prop-types';

const BlitzBoutAnswersCreator = ({ gameName, gameKey, answerData, newLeaderboard }) => {

    const handleNewLeaderboard = (e) => {
        e.preventDefault();

        newLeaderboard();
    }

    const blitzBoutMainLobbyWrapperStyle = {

        display: "flex",
        padding: "2%",
        flexDirection: "column",
        alignItems: "center",
        backgroundColor: "#334173",
        fontFamily: "poppins",
        fontColor: "white"

    }

    const blitzBoutPlayerListWrapperStyle = {

        display: "flex",
        padding: "1%",
        flexDirection: "row",
        justifyItems: "center",
        backgroundColor: "#e3e3ed",
        fontSize: "2.5em",
        fontFamily: "poppins",
        fontColor: "#334173"

    }

    // #e3e3ed

    const blueEmphasisStyle = {
        //color: "#334173",
        fontWeight: "bold"
    }

    const joinGamePanelStyle = {
        backgroundColor: "white",
        borderRadius: "10px",
        padding: "1%",
        margin: "2%",
        display: "flex",
        justifyContent: "space-around",
        minWidth: "80%"
    }

    const keyStyle = {
        float: "right"
    }

    const mainContentWrapperStyle = {
        display: "flex",
        flexDirection: "column",
        alignItems: "center",
        backgroundColor: "#e3e3ed",
        fontFamily: "poppins",
        fontColor: "#334173"
    }

    const topperStyle = {
        minWidth: "80%",
        margin: "3%",
        marginBottom: "0"
    }

    const titleStyle = {
        display: "inline-block",
    }

    const nextButtonStyle = {
        float: "right",
        border: "grey solid 2px",
        padding: "1%"
    }

    const AnswerCard = ({ answer, index }) => {

        const userCardStyle = {
            display: "flex",
            flexDirection: "row",
            justifyItems: "center",
            backgroundColor: "white",
            fontSize: "1em",
            fontFamily: "poppins",
            fontColor: "#334173",
            padding: "2%",
            margin: "2%",
            minWidth: "25%"
        }

        const textStyle = {
            display: "inline-block",
            fontSize: "0.6em"
        }

        const amswerTextStyle = {
            display: "inline-block",
            fontSize: "0.6em",
            color: "green"
        }

        return (
            <div style={userCardStyle}>
                <h1 >{index}</h1>

                <h1 style={answer.state ? amswerTextStyle : textStyle}>{answer.answerText}</h1>

            </div>
        )
    }
    AnswerCard.propTypes = {
        answer: PropTypes.object,
        index: PropTypes.number
    }

    return (

        <div id="blitzBoutLobby">

            <main id="blitzBoutMainLobbyWrapper" style={blitzBoutMainLobbyWrapperStyle}>
                <div id="joinGamePanel" style={joinGamePanelStyle}>
                    <div id="Join">
                        <p>Join at</p>
                        <h5><span style={blueEmphasisStyle}>http://localhost:3000/games/BlitzBout/join</span></h5>
                    </div>
                    <div style={keyStyle}>
                        <p>GameKey:</p>
                        <h1><span style={blueEmphasisStyle}>{gameKey}</span></h1>
                    </div>
                </div>
            </main>

            <div id="mainContentWrapper" style={mainContentWrapperStyle}>
                <div id="topper" style={topperStyle}>
                    <h1 style={titleStyle}>{gameName}</h1>
                    <button onClick={(e) => handleNewLeaderboard(e)} style={nextButtonStyle}>Start game!</button>
                </div>
                <div id="blitzBoutPlayerListWrapper" style={blitzBoutPlayerListWrapperStyle}>
                    
                </div>
            </div>

            <div id="blitzBoutPlayerListWrapper" style={blitzBoutPlayerListWrapperStyle}>
                {answerData ? <h1>{answerData.question}</h1> : <h1>Err</h1>}
                {answerData ?
                    (answerData.answers ?
                        answerData.answers.map(
                            (answer, index) =>
                                <AnswerCard key={index} answer={answer} index={index} />
                        )
                        :
                        <h1>Err</h1>
                    )
                    :
                    <h1>Err</h1>
                }

            </div>

        </div>

    );

};
BlitzBoutAnswersCreator.propTypes = {
    gameName: PropTypes.string,
    gameKey: PropTypes.string,
    answerData: PropTypes.array,
    newLeaderboard: PropTypes.func
}

export default BlitzBoutAnswersCreator;
